      url: "https://redir.folha.com.br/redir/online/mercado/rss091/*https://aovivo.folha.uol.com.br/mercado/2021/11/01/6088-bolsas-dolar-e-empresas-acompanhe-ao-vivo-o-mercado.shtml#post412201",
