        "A Bolsa de Valores brasileira fechou em alta nesta segunda-feira (24), apoiada sobre ganhos Vale, Petrobras e bancos, que formam o núcleo do mercado acionário do país devido ao volume de negociações e atratividade para investidores estrangeiros.\nLeia mais (11/24/2021 - 18h36)",
