  12580104: {
    _index: "noticias",
    _type: "_doc",
    _id: "12580104",
    _score: 7.7409377,
    _source: {
      id: 12580104,
      "@timestamp": "2021-11-24T21:40:40.187Z",
      ativo: true,
      pub_data: "(2021,11,24,21,29,11,2,328,0)",
      category: null,
      title: "Ibovespa fecha em alta de 0,83%, aos 104.514,19 pontos",
      fonte_id: 26,
      criado: "2021-11-24T21:40:22.946Z",
      "@version": "1",
      url: "https://valor.globo.com/financas/noticia/2021/11/24/ibovespa-fecha-em-alta-de-083percent-aos-10451419-pontos.ghtml",
      source: "Valor",
      description:
        "    O Ibovespa fechou a sessão desta quarta-feira no campo positivo, puxado pelo alívio nos juros após fala do presidente do Banco Central, Roberto Campos Neto, pela alta das commodities metálicas e por um possível encaminhamento da PEC dos Precatórios em Brasília.\n\nApós ajustes, o índice avançou 0,83%, aos 104.514,19 pontos, emendando duas sessões consecutivas em alta. Na esteira da recuperação dos papéis de crescimento, Locaweb ON ganhou 4,84%, Lojas Americanas PN subiu 4,02%, Banco Pan PN avançou 5,19%, Banco Inter units teve alta de 4,02%, Magazine Luiza ON anotou ganho de 2,56% e Cogna ON teve valorização de 3,80%.\n\nEntre as blue chips, a Vale ON ganhou 2,32%, embalada pela alta nos preços do minério de ferro, que voltou a ser negociado a US$ 100 a tonelada no porto de Qingdao, na China. Os ganhos puxaram também as ações das siderúrgicas: Usiminas PNA subiu 3,48%, Gerdau PN teve ganhos de 1,64% e CSN ON avançou 1,64%.\n\nJá na ponta negativa do índice, PetroRio ON cedeu 3,75%, Grupo Natura caiu 3,64% e Marfrig ON perdeu 2,14%. O setor de saúde caiu em bloco: Rede D'Or ON recuou 3,12%, Hapvida ON teve queda de 2,41% e Intermédica ON caiu 2,38%.\n\nSilvia Zamboni/Valor",
      modificado: "2021-11-24T21:40:22.946Z",
    },
    sort: ["2021-11-24T21:40:22.946Z", 7.7409377],
  },
