  12580656: {
    _index: "noticias",
    _type: "_doc",
    _id: "12580656",
    _score: 7.064208,
    _source: {
      id: 12580656,
      "@timestamp": "2021-11-24T21:57:40.230Z",
      ativo: true,
      pub_data: "2021-11-24 21:41:00+00",
      category: null,
      title:
        "Ibovespa sobe pelo 2º dia, em alta de 0,83%, aos 104,5 mil pontos",
      fonte_id: 62,
      criado: "2021-11-24T21:57:23.719Z",
      "@version": "1",
      url: "https://istoe.com.br/ibovespa-sobe-pelo-2o-dia-em-alta-de-083-aos-1045-mil-pontos/",
      source: "Isto É",
      description:
        "Mesmo com pouco fôlego nos índices de ações no exterior, e com petróleo embicando para o negativo, o Ibovespa conseguiu emendar nesta quarta-feira, 24, segundo dia de recuperação parcial, chegando a testar a linha dos 105 mil pontos no melhor momento da sessão. Ao fim, com desempenho positivo das ações de commodities, siderurgia e bancos, a referência da B3 mostrava alta de 0,83%, aos 104.514,19 pontos, entre mínima de 102.464,29 e máxima de 105.041,16 pontos, saindo de abertura aos 103.651,88 pontos. O nível de fechamento foi o melhor desde o dia 12, com o índice tendo permanecido na faixa de 102 a 103 mil pontos nos últimos cinco encerramentos.\n\nModerado nesta véspera de feriado de Ação de Graças nos Estados Unidos, o giro foi de R$ 26,9 bilhões. Na semana, o Ibovespa sobe agora 1,44% e, no mês, 0,98%, enquanto no ano as perdas estão em 12,19%. Desde o último dia 17, o Ibovespa não tocava a marca de 105 mil pontos no intradia – e a última vez em que fechou acima de tal nível foi exatamente em 12 de novembro, então aos 106.334,54 pontos.\n\n“Não há desdobramentos novos que justifiquem celebração. A Bolsa ficou muito amassada e subiu nessas últimas duas sessões movida por volatilidade de curto prazo. A tendência ainda é negativa, com queda na confiança do consumidor e revisões nas projeções de PIB, pra baixo, e de inflação, pra cima. A PEC foi mais um jeitinho brasileiro para fazer populismo, e se não for pela PEC, será por MP. Não há nenhum fator para embasar essa alta”, diz Leonardo Milane, economista e sócio da VLGI.\n\n“As ações de commodities e de exportadoras têm contribuído para o Ibovespa, mas a incerteza em torno da PEC dos Precatórios ainda é alta”, observa Rodrigo Franchini, sócio da Monte Bravo Investimentos. Nesta quarta-feira, Petrobras ON e PN avançaram, respectivamente, 1,95% (máxima do dia no encerramento) e 2,05%, mesmo com o sinal negativo do petróleo à tarde, enquanto Vale ON encerrou o dia em alta de 2,32% (também na máxima da sessão) e os ganhos no setor de siderurgia chegaram a 3,48% (Usiminas PNA), com a recuperação em curso nos preços do minério de ferro na China. Entre os grande bancos, os ganhos nesta quarta-feira ficaram entre cerca de 2% e 3% ao longo da tarde, com destaque para Itaú PN (+2,67% no fechamento).\n\nNo exterior, a semana, na prática mais curta pelo feriado desta quinta-feira nos Estados Unidos, foi marcada também pela progressão dos rendimentos dos Treasuries, especialmente o do prazo de 10 anos, induzindo ajuste no Nasdaq, mas também afetando os outros índices acionários de Nova York em meio à reponderação do momento, possivelmente no ano que vem, em que o Federal Reserve, após a conclusão da retirada de estímulos, deve começar a elevar a taxa de juros de referência.\n\nConforme a ata da mais recente reunião de política monetária do BC americano, divulgada nesta tarde, alguns dirigentes sinalizaram preferência por ritmo mais rápido de redução das compras de ativos, o chamado ‘tapering’. Com a informação, os juros dos Treasuries longos reduziram perdas na sessão e os índices acionários de Nova York voltaram a se enfraquecer.",
      modificado: "2021-11-24T21:57:23.719Z",
    },
    sort: ["2021-11-24T21:57:23.719Z", 7.064208],
  },
