  12583150: {
    _index: "noticias",
    _type: "_doc",
    _id: "12583150",
    _score: 9.682546,
    _source: {
      id: 12583150,
      "@timestamp": "2021-11-24T23:21:40.183Z",
      ativo: true,
      pub_data: "(2021,11,24,22,41,0,2,328,0)",
      category: null,
      title:
        "Dólar fecha abaixo de R$ 5,60 com acordo sobre PEC dos Precatórios",
      fonte_id: 340,
      criado: "2021-11-24T23:21:29.423Z",
      "@version": "1",
      url: "https://agenciabrasil.ebc.com.br/economia/noticia/2021-11/dolar-fecha-abaixo-de-r-560-com-acordo-sobre-pec-dos-precatorios",
      source: "Agência Brasil - Econimia",
      description:
        "A definição de um acordo para a votação no Senado da Proposta de Emenda à Constituição (PEC) dos Precatórios blindou o dólar das turbulências no mercado internacional e fez a moeda cair para abaixo de R$ 5,60. A bolsa de valores subiu pelo segundo dia consecutivo e está no maior nível em quase duas semanas.\n\nO dólar comercial fechou esta quarta-feira (24) vendido a R$ 5,595, com recuo de R$ 0,014 (-0,26%). A cotação chegou a R$ 5,62 na máxima do dia, pouco antes das 11h, mas desacelerou durante a tarde e fechou em queda, após o anúncio de que a Comissão de Constituição e Justiça do Senado pretende votar a PEC dos Precatórios na terça-feira (30).\n\nO real teve desempenho diferente das moedas dos países emergentes, que voltaram a ser afetadas pela alta do dólar por causa do mercado internacional. A ata da última reunião do Federal Reserve (Fed, Banco Central norte-americano), divulgada hoje, indicou que diversos diretores apoiam uma retirada mais rápida dos estímulos monetários concedidos desde o início da pandemia de covid-19.\n\nNo mercado de ações, o dia também foi marcado pela recuperação. O índice Ibovespa, da B3, fechou aos 104.514 pontos, com alta de 0,83%. Numa sessão volátil, o indicador chegou a cair 1,13% no pior momento do dia, mas inverteu o movimento por causa do acordo para a votação da PEC dos Precatórios e da ajuda de ações de empresas mineradoras, beneficiadas pela valorização internacional do minério de ferro.\n\nApesar de a PEC dos Precatórios aumentar os gastos públicos em R$ 101,6 bilhões no próximo ano, os investidores acreditam que a aprovação da proposta evita soluções mais imprevisíveis. Para os analistas financeiros, um eventual decreto de calamidade pública abriria mais espaço para gastos além do teto.\n\n* Com informações da Reuters",
      modificado: "2021-11-24T23:21:29.423Z",
    },
    sort: ["2021-11-24T23:21:29.423Z", 9.682546],
  },
